El poema es un soneto de Francisco de Quevedo (1580-1645), uno de los más grandes poetas del Siglo de Oro español, perteneciente al movimiento literario del Barroco. El texto hace referencia al reconocimiento y la gratitud que merece quien libera o salva a otros, comparando la actitud de Roma con la posible respuesta de España.
